, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1274642","type":"CustomJS"},{"attributes":{},"id":"1274459","type":"LinearScale"},{"attributes":{},"id":"1274501","type":"LinearScale"},{"attributes":{},"id":"1274670","type":"AllLabels"},{"attributes":{"children":[[{"id":"1274455"},0,0],[{"id":"1274495"},1,0],[{"id":"1274586"},2,0]]},"id":"1274689","type":"GridBox"},{"attributes":{},"id":"1274581","type":"UnionRenderers"},{"attributes":{"data":{"Close":{"__ndarray__":"UrgeheuhUECkcD0K1yNQQOF6FK5HcVBA4XoUrkehUEBmZmZmZnZQQK5H4XoUzlBAuB6F61F4UECkcD0K16NQQFK4HoXrEVFAXI/C9SgsUUDsUbgehetQQDMzMzMzk1BAH4XrUbiOUED2KFyPwlVQQBSuR+F6NFBA9ihcj8KVUEDD9Shcj3JQQGZmZmZmllBAMzMzMzPzUEApXI/C9RhRQBSuR+F6tFBA9ihcj8J1UUBI4XoUrpdRQNejcD0KZ1FApHA9CtfTUUCamZmZmTlSQM3MzMzM7FFAzczMzMzsUUB7FK5H4YpRQIXrUbgelVFACtejcD3qUUCPwvUoXP9RQM3MzMzM3FFAZmZmZmbWUUCPwvUoXO9RQDMzMzMzs1FAPQrXo3DdUUApXI/C9ahRQF
